    url: /usr/local/include/google/protobuf
  - name: retag
    url: github.com/pubgo/protobuild
    path: /retag
    version: v0.0.7
plugins:
  - name: go
    out: gen/proto
    opt: paths=import
  - name: go-grpc
    out: gen/proto
    opt:
      - paths=import
      - require_unimplemented_servers=false
  - name: grpc-gateway
    out: gen/proto
    opt:
      - paths=import
